import { useState, useEffect } from 'react'
import personsService from './services/notes'

const App = () => {
  const [persons, setPersons] = useState([]) 

  useEffect(() => {
    personsService
      .getAll()
      .then(response => {
        setPersons(response.data)
      })
  }, [])



}
